import './Login.css';
import { useAuth0 } from "@auth0/auth0-react";

function Login() {
    const { loginWithRedirect } = useAuth0();
    return (
    <>
    <Header/>
      <h1>Hello , you're Login</h1> 
    </>
  );
}

export default Login;
